sys_variable_value.value:
(function execute(inputs, outputs) {
  gs.info("Inside action")
  outputs.contacts = [];
  var order = 1
  var mo, finPoc;
  while (inputs.m2m.next()) {
       var contact = inputs.m2m.contacts;
        outputs.contacts.push({
          formal_name: contact.formal_name,
          email: contact.email,
          role_name: "role name",
          recipient_order: order.toPrecision(1),
          contact_type: contact.type.getDisplayValue()
        })
    order++;

    if (contact.type.getDisplayValue() === "Mission Owner") {
      outputs.mo = contact.toString() // use toString() to get sys_id
    }
    if (contact.type.getDisplayValue() === "Financial POC") {
      outputs.fin_poc = contact.toString()
    }
  }

  var TABLE = "x_g_dis_atat_contacts"
  var gr = new GlideRecord(TABLE)
  gr.addQuery("type", "JWCC_CONTRACTING_OFFICER")
  gr.query()
  gr.next()
  outputs.ko = gr

  // get the glide records for MO, KO, Fin POC in a query that were found
  // above to gather as glid records to output
  var packageRecords = outputs.mo + "," + outputs.fin_poc + "," + outputs.ko.sys_id
  var records = new GlideRecord(TABLE)
  records.addQuery("sys_id", "IN", packageRecords)
  records.query()
  // outputs.contact_records = outputs.mo + "," + outputs.fin_poc + "," + outputs.ko
  // outputs.contact_records = outputs.ko // works, but only one record
  outputs.contact_records = records

  // gs.info("records: " + inputs.m2m.next())
  // gs.info("contact: " + inputs.m2m.contacts)
  // gs.info("last name: " + inputs.m2m.contacts.last_name.toString())

})(inputs, outputs);

